local function fromhex(h)
    h = h:gsub('%s+', '')
    local out = {}
    for cc in h:gmatch('..') do
        out[#out + 1] = string.char(tonumber(cc, 16))
    end
    return table.concat(out)
end

local function checksum(s)
    local t = 0
    for i = 1, #s do
        t = (t + s:byte(i)) % 4294967291
    end
    return t
end

local parts = {
    [[]],
    [[]],
    [[]],
    [[]],
    [[]],
}

local hex = table.concat(parts)
local payload = fromhex(hex)

if checksum(payload) ~= 1480706 then
    return warn('[obf] checksum mismatch (tampered file?)')
end

local f, err = loadstring(payload)
if not f then
    return warn('[obf] compile error: ' .. tostring(err))
end
local ok, runerr = pcall(f)
if not ok then
    warn('[obf] runtime error: ' .. tostring(runerr))
end
